import React from 'react';
import { motion } from 'framer-motion';

const Footer = () => {
  const socialLinks = [
    { name: 'Instagram', url: 'https://instagram.com/bluepolaroid05' },
    { name: 'YouTube', url: 'https://youtube.com/@bluepolaroid05' },
    { name: 'Email', url: 'mailto:raghavsobti37@gmail.com' }
  ];

  return (
    <motion.footer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ delay: 0.5 }}
      className="footer"
    >
      <div className="footer-content">
        <div className="contact-info">
          <h3>Let's Connect</h3>
          <p>Phone: +91 85914 99393</p>
          <p>Email: raghavsobti37@gmail.com</p>
        </div>

        <div className="social-links">
          <h3>Follow Me</h3>
          <ul>
            {socialLinks.map((link, index) => (
              <li key={index}>
                <a href={link.url} target="_blank" rel="noopener noreferrer">
                  {link.name}
                </a>
              </li>
            ))}
          </ul>
        </div>

        <div className="copyright">
          <p>&copy; {new Date().getFullYear()} Raghav Raj Sobti. All rights reserved.</p>
          <p>Designed with passion for visual storytelling.</p>
        </div>
      </div>
    </motion.footer>
  );
};

export default Footer;
